import Logo from './images/netflix.png'

function App() {
  return (
    <div className="flex items-center">
        <img src={Logo} alt='' className="w-44 flex " />
        <div className="flex space-x-4">
          <div>01</div>
          <div>02</div>
          <div>03</div>
        </div>
    </div>
  );
}

export default App;
